 John Marlowe, &quot;The World's Most Evil Psychopaths: Horrifying True-life Cases&quot;
English | ISBN: 1782126945, 0572033435 | 2014 | 392 pages | EPUB | 0.6 MB

The World's Most Evil Psychopaths provides a concise, yet detailed look at some of the most dangerous individuals who have ever lived. Starting with examples of the earliest recorded psychopaths, author John Marlowe presents a carefully chosen cross-section of history's most infamous criminals, whose fascinating life stories are viewed with an unflinching gaze, making for a chilling, but engrossing read. Part of the Arcturus Popular Reference series.
